B.al0=new A.b6("\uacb0\uc81c\uac00 \uc644\ub8cc\ub418\uc5c8\uc2b5\ub2c8\ub2e4.\n\n\uce74\ud1a1 \ucc44\ub110\ub85c '\uacb0\uc81c\uc644\ub8cc'\ub77c\uace0 \ub9d0\uc500\ud574\uc8fc\uc138\uc694.\n\ub2f4\ub2f9\uc790\uac00 \ud655\uc778 \ud6c4, \uc218\uc5c5 \ud655\uc815 \uc548\ub0b4\ub4dc\ub9ac\ub3c4\ub85d \ud558\uaca0\uc2b5\ub2c8\ub2e4.",null,B.ft,B.W,null,null,null,null,null,null,null)
